import Head from 'next/head';
import Main from '../components/main';
import Sidebar from '../components/sidebar';

export default function Home() {
  return (
    <>
      <Head>
        <title>Create Sketch Assistant</title>
      </Head>
      <div style={{ display: 'flex' }}>
        <Sidebar />
        <Main />
      </div>
    </>
  )
}
